define("tpl/media/appmsg.html.js", [], function () {
    return '<div class="appmsg {if isMul}multi{/if}" data-id="{id}" data-fileid="{file_id}" data-completed="{completed===true?1:2}">\n    <div class="appmsg_content">\n        {if isMul}\n            <div class="appmsg_info">\n                <em class="appmsg_date">{time}</em>\n            </div>\n            <div class="cover_appmsg_item">\n                <h4 class="appmsg_title js_title">\n                {if first.title&&first.cover}\n                    <a href="{first.content_url}" target="_blank">{first.title||"未命名图文"}</a>\n                {else}\n                    <spa>{first.title||"未命名图文"}</span>\n                {/if}\n                </h4>\n                <div class="appmsg_thumb_wrp" style="background-image:url(\'{first.cover}\')">\n                    {if !first.cover}\n                    <div class="appmsg_thumb default">尚未设置封面</div>\n                    {/if}\n                </div>\n            </div>\n            {each list as item}\n            <div class="appmsg_item">\n                <div class="appmsg_thumb_wrp" style="background-image:url(\'{item.cover}\');">\n                    {if !item.cover}\n                    <div class="appmsg_thumb default">\n                        <span class="appmsg_thumb_tips">尚未设置封面</span>\n                        <span class="vm_box"></span>\n                    </div>\n                    {/if}\n                </div>\n                <h4 class="appmsg_title js_title">\n                    {if item.title&&item.cover}\n                        <a href="{item.content_url}" target="_blank">{item.title||"未命名图文"}</a>\n                    {else}\n                        <span>{item.title||"未命名图文"}</span>\n                    {/if}                    \n                </h4>\n            </div>\n            {/each}\n        {else}\n            <h4 class="appmsg_title js_title">\n                {if first.title&&first.cover}\n                    <a href="{first.content_url}" target="_blank">{first.title||"未命名图文"}</a>\n                {else}\n                    <spa>{first.title||"未命名图文"}</span>\n                {/if}                \n            {if first.isreprint}{/if}</h4>\n            <div class="appmsg_info">\n                <em class="appmsg_date">{time}</em>\n            </div>\n            <div class="appmsg_thumb_wrp" style="background-image:url(\'{first.cover}\')">\n                {if !first.cover}\n                <div class="appmsg_thumb default">尚未设置封面</div>\n                {/if}\n            </div>\n            <p class="appmsg_desc">{first.digest}</p>\n        {/if}\n        {if completed===false}\n        <div class="edit_mask">\n            <div class="edit_mask_content">\n                <p class="edit_mask_title">图文消息不完整</p>\n                <p class="">\n                    请先编辑好图文消息的标题、正文和封面图                </p>\n                <p class="edit_mask_opr">\n                <a target="_blank" href="/wxoss/wx_articles/edit?t=media/appmsg_edit&action=edit&lang=zh_CN&token={token}&type={type}&appmsgid={id}&isMul=1">继续编辑</a>\n                </p>\n            </div>\n            <span class="vm_box"></span>\n        </div>\n        {/if}\n    </div>\n    {if showEdit}\n    <div class="appmsg_opr">\n        <ul>\n            <li class="appmsg_opr_item grid_item size1of2">\n            <a target="_blank" class="js_tooltip" href="/wxoss/wx_articles/edit?t=media/appmsg_edit&action=edit&lang=zh_CN&token={token}&type={type}&appmsgid={id}&isMul=1" data-tooltip="编辑">&nbsp;<i class="icon18_common edit_gray">编辑</i></a>\n            </li>\n            <li class="appmsg_opr_item grid_item size1of2 no_extra">\n                <a class="js_del no_extra js_tooltip" data-id="{id}" href="javascript:void(0);" data-tooltip="删除">&nbsp;<i class="icon18_common del_gray">删除</i></a>\n            </li>\n        </ul>\n    </div>\n    {/if}        \n    {if showMask&&completed!==false}\n    <div class="appmsg_mask"></div>\n    <i class="icon_card_selected">已选择</i>\n    {/if}\n</div>\n';
});
